import React, { Component } from 'react';
import Button from 'react-bootstrap/Button';


class LongButton extends Component {
  render() {
    return (
        <Button
        title="Learn More"
        color="#841584"
        accessibilityLabel="Learn more about this purple button"
        />
    )
  }
}

export default LongButton;
